  // Verificar se o faturamento é acima de R$ 35.001
  const faturamentoAcima30k = (
    faturamento === "Entre R$35.001 e R$50.000 mensal" || 
    faturamento === "Entre R$50.001 e R$100.000 mensal" || 
    faturamento === "+ de R$100.001"
  );

  // Verificar se a equipe tem mais de 4 funcionários
  const equipeMaiorQue4 = (
    tamanhoEquipe === "ENTRE 4 E 5" || 
    tamanhoEquipe === "ENTRE 5 E 10" || 
    tamanhoEquipe === "ENTRE 10 E 20" || 
    tamanhoEquipe === "+ DE 20"
  );

  // Retornar qualificação com base nas condições
  if (faturamentoAcima30k && equipeMaiorQue4) {
    return "Extremamente Qualificado";
  } else if (faturamentoAcima30k) {
    return "Qualificado";
  } else {
    return "Desqualificado";
  }
}

