const ano = dataAtual.getFullYear();
const mes = String(dataAtual.getMonth() + 1).padStart(2, '0');
const dia = String(dataAtual.getDate()).padStart(2, '0');
const dataFormatada = `${ano}-${mes}-${dia}`;

// Montar o objeto de output com os campos atualizados
let output = {
  nome: formatarPrimeiraLetraMaiuscula(respostas.find(answer => answer.field.ref === "ff8b728c-119a-4ddc-9183-0c36a3d53748")?.text || ""),
  telefone: telefoneFormatado,
  email: respostas.find(answer => answer.field.ref === "e0bd47dc-72ed-497e-885b-3cfcdc48adaa")?.email || '',
