  sonho2025: respostas.find(answer => answer.field.ref === "5fe6dab9-dcc1-4984-9408-cc43f052fe64")?.text || "",
  Instagram: respostas.find(answer => answer.field.ref === "69e277e4-a0f8-4865-b01d-970dee3d88eb")?.text.replace(/@/g, "") || "",
  tem_recepcionista: respostas.find(answer => answer.field.ref === "9d3235d4-a79e-455d-ac75-4254b19cae96")?.choice.label || "",
  tamanho_da_equipe: respostas.find(answer => answer.field.ref === "f4fcda9e-a288-4558-94d9-3e2b0b4f96ad")?.choice.label || "",
  faturamento: faturamento,
  objetivo_este_ano: respostas.find(answer => answer.field.ref === "5fe6dab9-dcc1-4984-9408-cc43f052fe64")?.text || "",
  impede_objetivo: respostas.find(answer => answer.field.ref === "193b63eb-8173-4a1a-8fa0-c930cab89161")?.text || "",
  promocao_black_friday: respostas.find(answer => answer.field.ref === "6bb1a2d8-3e8a-4a45-9962-ed5696f15a3b")?.choice.label || "",
  plano_mentoria: respostas.find(answer => answer.field.ref === "5e78a656-8fa3-4eda-91fd-2054e491e35e")?.text || "",
  investimento_compromete_fluxo: respostas.find(answer => answer.field.ref === "7f0aa59a-b2c4-4c61-8e0f-e620db6e010e")?.choice.label || "",
  inicio_mentoria: inicioMentoria,
  data_ultima_quinzena: dataFormatada,  
  utm_content: utmContent || "",
  utm_source: utmSource || "",
  utm_campaign: utmCampaign || "",
  utm_medium: utmMedium || "",
  utm_term: utmTerm || "",
  Ending: ending
};

// Adicionar a qualificação com base em `ending` e `faturamento`
output.qualificacao = determinarQualificacao(
  output.faturamento,
  output.Ending
);

// Adicionar a informação do país se o número de telefone começar com '351'
if (telefoneFormatado.startsWith('351')) {
  output = { ...output, Pais: "Portugal" };
}

return [output];
